INSERT INTO `about_us` VALUES (1,'Ibyerekeye Agezweho','Agezweho is a leading news portal dedicated to bringing you the most relevant and up-to-date stories from Rwanda and around the world. Our mission is to provide accurate, timely, and insightful news that empowers our readers to make informed decisions. From politics to entertainment, business to sports, we cover a wide range of topics to keep you informed about what\'s shaping the world today. Our team of experienced journalists works around the clock to bring you the latest breaking news, ensuring that you are always in the know. At Agezweho, we believe in delivering news with integrity, transparency, and a commitment to excellence.','2024-11-20 14:04:22','2024-11-30 08:00:20');
